message:
/* Publicly expressed interest */Ted Cruz filing with the FEC for Re-election does not mean he won't run for President! He has more than once expressed a desire to run again, I can see demoting him to potential, but unless he comes out and states that he will run for re-election then he doesn't belong in declined!

Also Sherrod Brown has publicly declared that he will run for re-election and has never expressed any desire to be president and he's listed as potential for the democrats! 

Filin...
